/** 
 * Adds a SortField to the bindings.
 * <p>
 * This can be used to reference a DocValuesField, a field from
 * FieldCache, the document's score, etc. 
 */
public void add(SortField sortField) {
  map.put(sortField.getField(), sortField);
}

